import { useSearchParams } from "react-router-dom";

function Title() {

    const [searchParams, setSearchParams] = useSearchParams();

    const updateFilter = () => {
        setSearchParams({ title: '2'});
    };

    return (
        <div>
            <h1>Home</h1>
            <p>Filtro actual: {searchParams.get('title')}</p>
            <button onClick={updateFilter}>Actualizar filtro</button>
        </div>
    );
  }
  
  export default Title;
